import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom';
import './App.css';
import ViewCourse from './view_course'


function ManageCourse(){
    return (
        <div>
            <Router>
            <h2>Manage Course</h2>
            <ul className="sub_nav">
                <Link to="/manage_course/view_courses" className="link_href">
                    <li className="bg-info link nav_links">View Course</li>
                </Link>
                &nbsp;|&nbsp;
                <Link to="/manage_course/view_courses" className="link_href">
                    <li className="bg-info link nav_links">Add Course</li>
                </Link>
                &nbsp;|&nbsp;
                <Link to="/manage_course/view_courses" className="link_href">
                    <li className="bg-info link nav_links">Delete Course</li>
                </Link>
            </ul>
                    <Switch>
                        <Route path="/manage_course/view_courses" component={ViewCourse} />
                    </Switch>
            </Router> 
        </div>
    );
}

